%angular
<div id="test"></div>
<script>

function testD3() {
    console.log("testD3");
    var el = angular.element($('#test')).parent(".ng-scope");
    angular.element(el).ready(function() {
        var diameter = 960,
            format = d3.format(",d")
            color = d3.scale.category20c();

        var bubble = d3.layout.pack()
                    .sort(null)
                    .size([diameter, diameter])
                    .padding(1.5);

        var svg = d3.select("#test").append("svg")
                    .attr("width", diameter)
                    .attr("height", diameter)
                    .attr("class", "bubble");

        d3.json({{bubbleData}}, function(error, root) {
            console.log("d3.data");
            var node = svg.selectAll(".node")
                        .data(bubble.nodes(classes(root))
                        .enter().append("g")
                        .attr("class", "node")
                        .attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; });

            node.append("circle")
                .attr("r", function(d) { return d.r; })
                .style("fill", function(d) { return color(d.ZoneID); });


        });


    });

}

if(window.d3) {
    console.log("d3 already loaded");
    testD3();
} else {
    console.log("loading d3 library");
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/d3/3.5.16/d3.min.js';
    sc.onload = testD3;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
